desc:
Как создать турецкий и украинский аккаунты Playstation???
Всегда выскакивают ошибки типа &#34;Время соединения истекло&#34; или &#34;Не удалось создать аккаунт свяжитесь с техподдержкой Сони&#34; 
Никакой ВПН не работает, почему непонятно, я же как типа из Турции или Украины пытаюсь создать аккаунт

Какие по вашему опыту/опыту знакомых и тд. специалисты естественного направления(химия/биология/физика) и тд. востребованы зарубежом? 
Например в немецкоязычных странах..
Предвосхищая ваши вопросы: я планирую получить сначала здешнее высшее образование; иностранными языками я владею на среднем (пока что) уровне в количестве 4 штук.(у меня даже есть неоконченное высшее факультета ин.яза);

Я хочу сделать мини мод на игре юнити, но имею мало опыта в разработке и увидя много гайдов начал по ним делать, и застрял на моменте в создании ассета
взял этот код за пример
using UnityEditor;
public class CreateAssetBundles
{
    [MenuItem(&#34;Assets/Create Build AssetsBundles&#34;)]
    private static void BuildAllBundles()
    {
            BuildPipeline.BuildAssetBundles(&#34;Assets/AssetBundles&#34;, BuildAssetBundleOptions.None, EditorUserBuildSettings.activeBuildTarget);
    }
} Выходит ошибка CS0246 &#34;MenuItem&#34; и CS0246 &#34;MenuItemAttribute&#34;
и похожий, но ошибка и там и там одна и таже, а если не она то он не находит путь к папке, если указать точную папку то ошибка выше
